  return (<div>
    <img src={props.imgsrc} title={props.titlename} alt={props.altkey}/>

  </div>);
}

ReactDom.render(<Cards imgsrc="https://logos-world.net/wp-content/uploads/2020/04/Netflix-Emblem.jpg" titlename="netflix" altkey="images"/>,document.querySelector('#root'));
